        <div id="matrix">
        </div>

      <style>
#matrix {
  position: absolute;
  top: 0;
  left: 0;
  width: 100%;
  height: 100%;
  background-color: transparent;
  color: #f1f1f1;
  font-family: monospace;
  overflow: hidden;
}
.matrix-char {
  position: absolute;
  display: inline-block;
  font-size: 10px;
  animation: matrix-animation 20s linear infinite;
}
@keyframes matrix-animation {
  0% {
    transform: translateY(0);
  }
  100% {
    transform: translateY(-100%);
  }
}
</style>
      <script>
const matrix = document.getElementById("matrix");
const characters = "01".split("");
const getRandomCharacter = () => characters[Math.floor(Math.random() * characters.length)];
const createColumn = () => {
  const column = document.createElement("div");
  column.classList.add("matrix-column");
  for (let i = 0; i < 30; i++) {
    const character = document.createElement("span");
    character.classList.add("matrix-char");
    character.textContent = getRandomCharacter();
    column.appendChild(character);
  }
  return column;
};
if (window.innerWidth <= 480) {
  for (let i = 0; i < 10; i++) {
    if (Math.random() > 0.1) {
      const column = createColumn(5);
      matrix.appendChild(column);
    }
  }
} else {
  for (let i = 0; i < 20; i++) {
    if (Math.random() > 0.1) {
      const column = createColumn(20);
      matrix.appendChild(column);
    }
  }
}
const matrixChars = document.querySelectorAll(".matrix-char");
matrixChars.forEach(char => {
  char.style.top = `${Math.floor(Math.random() * 100)}%`;
  char.style.left = `${Math.floor(Math.random() * 100)}%`;
  char.style.animationDuration = `${Math.random() * 2 + 1}s`;
  char.style.animationName = "matrix-animation";
  char.style.fontSize = `${Math.floor(Math.random() * 9) + 5}px`;
  char.style.filter = `blur(${Math.floor(Math.random() * 8) / 4}px)`;
});
setInterval(() => {
  matrixChars.forEach(char => {
    char.textContent = getRandomCharacter();
  });
}, 1000);
// Set the percentage of characters to display in the chosen color
const percentage = 10;
// Set the color of the characters
const color = "ffffff";
matrixChars.forEach((char, index) => {
  // Set the color of the character based on the percentage
  if (index % (100 / percentage) === 0) {
    char.style.color = color;
  } else {
    char.style.color = "#f1f1f1";
  }
});
</script>
